  return (
    <Layout>
        <h1>List of users</h1>
      <ul className="list-group">
        {/*  {data.map((user) => {
            <li className="list-group-item">{user.name}</li>
         })} */}
         <Prices bpi={data.bpi} />
      </ul>
    </Layout>
  );
};

